  "text": "Climate change United States mein agriculture par kafi asar kar raha hai. Misal ke tor par, barhtay temperatures ne drought ka sabab bana hai, jis ki wajah se crop yields aur livestock production kam ho gayi hai. Is ke ilawa, storms aur hurricanes ki barhi hui frequency aur intensity ne zyada soil erosion aur kam soil fertility ka sabab bana hai. Garam temperatures pests aur weeds mein izafa ka sabab bhi bante hain, jo crops ke liye nuqsan deh hain aur control karna mushkil hai.\n\nMoreover, climate change growing season mein tabdeeliyan aur irrigation ke liye paani ki availability mein kami ka sabab ban raha hai. Drought aur water shortages crop production ke liye bara khatara hain aur yields par bura asar dal sakte hain. Finally, climate change ne wildfires ka khatara barha diya hai, jo agricultural land aur crops ko nuqsan pahunchate hain.\n\nAgriculture par climate change ke asraat sirf food production ko khatare mein nahi dal rahe, balke economic losses ka sabab bhi ban rahe hain. Is ki wajah se, climate change se nipatne ke liye action lena zaroori hai taki agricultural production ko bachaya ja sake. Is mein water management behtar karna, infrastructure aur practices ko adapt karna, aur sustainable farming practices ke sath crop lands ki hifazat karna shamil hai."
}
```

